import styled from 'styled-components';
export const Div0 = styled.div`
    width: 100%;
    height: 800px;
    margin: 0 auto;
    overflow: hidden;
    min-width: 1200px;
    background:red;

`
export const Divtop = styled.div`
width: 94%;
height: 4%;
margin: 27px auto;
margin-left: 5%;
border-radius: 5px;
overflow: hidden;

`
